After initially being introduced in the &quot;X-Men: Evolution&quot; TV series, X-23 became such a popular character that Marvel wanted to get her into regular continuity as soon as possible. Her initially debut, the minseries, NYX:, showed off her skills but didn't give her origins. The is the first series where we get to know Laura Kinney from the start - a pretty face that masks a killing machine every bit as lethal as Wolverine, with whom she shares her genetic material. We see her struggles with fighting her programming while also accepting it, and coping with the larger outside world after being sequestered in the Weapon Plus prougram for so long. Craig Kyle and Chris Yost team up for the story, titled &quot;Innocence Lost&quot;, and Billy Tan does some great art. This digital copy of the limited series is thanks to ZoneKing-Empire. Please seed, enjoy! :-)
